import axios from "axios";

export function Get(url, params, callback) {
    try {
        axios.get(url, { params }).then((data) => {
            if (data && data.status === 200)
                callback(data);
        })
    }
    catch (e) {
        callback(e);
    }
}

export async function AsyncGet(url, params) {
    try {
        axios.get(url, { params }).then((data) => {
            if (data && data.status === 200)
                return (data);
        })
    }
    catch (e) {
        return (e);
    }
}

export function Post(url, obj, callback) {
    try {
        axios.post(url, obj).then((data) => {
            if (data && data.status === 200)
                callback(data.data);
        })
    }
    catch (e) {
        callback(e);
    }
}
